Happy Tuesday! Here's a useful mini-R function that loads individual objects from an .rdata file:

extractorRData &lt;- function(file, object) {
      E &lt;- new.env()
      load(file=file, envir=E)
      return(get(object, envir=E, inherits=F))
}
